import React from 'react';
import { Routes, Route } from 'react-router-dom';
import { AuthProvider } from './contexts/AuthContext';
import { ThemeProvider } from 'styled-components';
import Layout from './components/Layout/Layout';
import Home from './pages/Home/Home';
import Login from './pages/Login/Login';
import Register from './pages/Register/Register';
import VendorProfile from './pages/VendorProfile/VendorProfile';
import VendorList from './pages/VendorList/VendorList';
import Dashboard from './pages/Dashboard/Dashboard';
import Wishlist from './pages/Wishlist/Wishlist';
import BookingForm from './pages/BookingForm/BookingForm';
import Profile from './pages/Profile/Profile';
import Photos from './pages/Photos/Photos';
import Einvites from './pages/Einvites/Einvites';
import Blog from './pages/Blog/Blog';
import RealWeddings from './pages/RealWeddings/RealWeddings';
import Reviews from './pages/Reviews/Reviews';
import NotFound from './pages/NotFound/NotFound';

const theme = {
  colors: {
    primary: '#8B4513',
    secondary: '#CD853F',
    accent: '#DEB887',
    background: 'linear-gradient(135deg, #FCE4EC 0%, #FFF8E1 100%)',
    white: '#FFFFFF',
    gray: '#666666',
    lightGray: '#E5E5E5',
    success: '#4CAF50',
    warning: '#FF9800',
    error: '#F44336',
    text: '#333333',
  },
  fonts: {
    primary: 'Roboto, sans-serif',
    heading: 'Playfair Display, serif',
  },
  breakpoints: {
    mobile: '768px',
    tablet: '1024px',
    desktop: '1200px',
  },
  shadows: {
    light: '0 4px 15px rgba(0, 0, 0, 0.1)',
    medium: '0 6px 20px rgba(0, 0, 0, 0.1)',
    heavy: '0 12px 30px rgba(0, 0, 0, 0.15)',
  },
};

function App() {
  return (
    <ThemeProvider theme={theme}>
      <AuthProvider>
        <Layout>
          <Routes>
            <Route path="/" element={<Home />} />
            <Route path="/login" element={<Login />} />
            <Route path="/register" element={<Register />} />
            <Route path="/vendors" element={<VendorList />} />
            <Route path="/vendors/all/wedding-venues" element={<VendorList />} />
            <Route path="/vendors/all/wedding-photographers" element={<VendorList />} />
            <Route path="/vendors/all/wedding-decorators" element={<VendorList />} />
            <Route path="/vendors/all/wedding-catering" element={<VendorList />} />
            <Route path="/vendor/:id" element={<VendorProfile />} />
            <Route path="/dashboard" element={<Dashboard />} />
            <Route path="/wishlist" element={<Wishlist />} />
            <Route path="/booking/:vendorId" element={<BookingForm />} />
            <Route path="/profile" element={<Profile />} />
            <Route path="/photos" element={<Photos />} />
            <Route path="/einvites" element={<Einvites />} />
            <Route path="*" element={<NotFound />} />
          </Routes>
        </Layout>
      </AuthProvider>
    </ThemeProvider>
  );
}

export default App;
